import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const App = () => {
    return <Headline />;
  };
  const Headline = () => {
    const greeting = 'Hello Function Component!';
    const [great,settgreat] = useState('hello function new component');
    return (
    <div>
    <h1>{great}</h1>
    <input type="text" value={great} 
    onChange={event => settgreat(event.target.value)} />
    </div>
    );
  };

  ReactDOM.render(<App />,document.getElementById('root'));
